function getCityList(n){$.ajax({type:"Get",url:"/destinations/GetCityList/"+n,contentType:"application/json; charset=utf-8",dataType:"json",success:function(n){var t='<div class="col-12 pl-0 pr-0 pb-4">Cities in '+n[0].couNA+'<\/div><div class="col-12 pl-0 pr-0">';$.each(n,function(n,i){t=t+'<a role="button" class="btn btn-outline-light btn-block border border-light border-right-0 border-left-0 border-top-0 text-left font-weight-bold pt-2 pb-2 m-0 dvCity">'+i.ctyNA+"<\/a>"});t=t+"<\/div>";$(".modal-body").html("");$(".modal-body").append(t)},error:function(n){$(".modal-body").html(n.responseText)}})}$(document).ready(function(){$(".searchBox").keydown(function(n){var r=new RegExp("^[a-zA-Z]*$"),i=[8,37,39,46],t=n.which?n.which:n.keyCode,u=$.inArray(t,i==!1)?String.fromCharCode(t):"";if(!r.test(u)&&inArray(t,i)==!1)return n.preventDefault(),!1}).keyup(function(){var t=$(this).attr("id").replace("i",""),n;t==1?$("#i2").val($("#i1").val()):$("#i1").val($("#i2").val());n=$("#i1").val();n.trim()==""?$(".dvCountryRow").show():$(".dvCountryRow").each(function(){var t=$(this).attr("data-name").toLowerCase();t.startsWith(n.toLowerCase())==!1?$(this).hide():$(this).show()})});$(".btnMod").click(function(n){var t=n.target.id;getCityList(t)})});